import { Bar } from "react-chartjs-2";

const Home = () => {
  // Fake student data
  const studentsData = {
    labels: ["John", "Emily", "David", "Sarah", "Michael"],
    datasets: [
      {
        label: "Grades",
        data: [85, 92, 78, 88, 95],
        backgroundColor: "rgba(75, 192, 192, 0.6)",
        borderColor: "rgba(75, 192, 192, 1)",
        borderWidth: 1,
      },
    ],
  };

  return (
    <div>
      <h2>Student Grades</h2>
      <Bar data={studentsData} />
    </div>
  );
};

export default Home;
